import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Link from '@material-ui/core/Link';
import GitHubIcon from '@material-ui/icons/GitHub';
import InstagramIcon from '@material-ui/icons/Instagram';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import HomeIcon from '@material-ui/icons/Home';

const useStyles = makeStyles(theme => ({
    icon: {
        marginRight: theme.spacing(2),
    }
}))

export default function NavBar() {
    const classes = useStyles();

    return (

        <AppBar style={{ backgroundColor: "#00695D" }} position="relative">
            <Toolbar>
                <Link color="inherit" href="https://github.com/znylen88"><GitHubIcon className={classes.icon}></GitHubIcon></Link>
                <Link color="inherit" href="https://www.instagram.com/zachy_d/?hl=en"><InstagramIcon className={classes.icon}></InstagramIcon></Link>
                <Link color="inherit" href="https://www.linkedin.com/in/zachary-nylen-52265b192/"><LinkedInIcon className={classes.icon}></LinkedInIcon></Link>
                <div style={{ alignItems: "center" }}>
                <Link style={{ display: "inline-block" }} color="inherit" href="https://www.linkedin.com/in/zachary-nylen-52265b192/"><HomeIcon className={classes.icon}></HomeIcon></Link>
                </div>
            </Toolbar>
        </AppBar>

    )
}
